import React from "react";

import { QuestionType } from "../utils/types/individualQuestionType";

interface Props {
  data: QuestionType;
}

const Question: React.FC<Props> = ({ data }) => {
  return (
    <React.Fragment>
      <div>{data.uuid}</div>
    </React.Fragment>
  );
};

export default Question;
